use FreezeThaw qw(thaw);
my ($rulebook) = thaw(map { chomp($_) ; $_ } <DATA>);

sub process_move {
   (defined $_[1] && $_[0]->[0] =~ /^REPORT$/)                         ? ($_[1], $_[2], $_[3], [@{$_[4]}, "$_[1],$_[2],$_[3]"])
              : $_[0]->[0] =~ /^PLACE (\d+),(\d+),(\w+)$/              ? (@{$rulebook->{'PLACE'}->[$1]->[$2]->{$3}}, $_[4])
              : (defined $_[1] && $_[0]->[0] =~ /^(MOVE|LEFT|RIGHT)$/) ? (@{$rulebook->{$1}->[$_[1]]->[$_[2]]->{$_[3]}}, $_[4])
              : ($_[1], $_[2], $_[3], $_[4]);
}

sub process_input {
   scalar(@{$_[0]}) > 1 ? process_input([@{$_[0]}[1..(scalar(@{$_[0]}) - 1)]], process_move(@_)) : ([], process_move(@_));
}

print "$_\n" for (grep { $_ } @{(process_input([map { split /\n/, $_ } <>]))[4]});

